import React, { Component } from 'react'

export default class Reservation extends Component {
  render() {
    return (
        <div className='user' >
        <h3>{this.user.first_name} {this.user.last_name}</h3>
        <p>{this.user.bio}</p>
        <b>{this.user.isHappy ? "Happy" : "Unhappy"}</b>
        </div>
    )
  }
}
